import static org.junit.Assert.*;

import java.util.ArrayList;
import java.util.Random;

import org.junit.Test;

public class RadixSortTest {

	@Test
	public void test() {
		// testing data setup
		Random rn = new Random();
		ArrayList<Integer> small = new ArrayList<Integer>();
		ArrayList<Integer> large = new ArrayList<Integer>();
		// create a really large arraylist
		for(int i=0; i < 100000; i++) {
			large.add(1000000-i*55);
		}
		// create a small arraylist
		for(int i = 0; i < 10; i++) {
			small.add(1000 - i*55);
		}
		
		// testing objects
		RadixSort rs  = new RadixSort(large);
		RadixSort rs1 = new RadixSort(small);

		rs.tenRadix();
		rs1.tenRadix();
		String test = rs.Looping();
		String test2 = rs1.Looping();
		
		
		assertEquals("",test);
		assertEquals("5055606156707257808358909451000" ,test2);
	}

}
